import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  background-color: #ffffff;
  border-bottom: 1px solid #c1c2c3;
  display: fixed;
  justify-content: center;
`

const HeaderWrapper = styled.div`
  height: 100px;
  width: 1280px;
  align-items: center;
  display: flex;
  justify-content: space-between;
`

const LogoWrapper = styled.div`
  align-items: center;
  display: flex;
  justify-content: center;
  gap: 16px;
`

const Logo = styled.span``

const Title = styled.span`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 28px;
`

const ButtonWrapper = styled.div`
  gap: 36px;
  align-items: center;
  display: flex;
  justify-content: space-between;
`

const Button = styled.div``

const Navigator = styled.a`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 168px;
  height: 48px;
  border: 1px solid #5500dd;
  background-color: #ffffff;
  border-radius: 16px;
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 16px;
  color: #5500dd;
  text-decoration: none;
`

export const Header = () => {
  return (
    <Container>
      <HeaderWrapper>
        <LogoWrapper>
          <Logo>
            <img src="/source/main_logo.png" alt="jooda logo" />
          </Logo>
          <Title>주다</Title>
        </LogoWrapper>
        <ButtonWrapper>
          <Button>
            <a href="http://www.naver.com" target="_blank">
              <img src="/source/app_store.svg" alt="apple store" />
            </a>
          </Button>
          <Button>
            <a href="http://www.google.com" target="_blank">
              <img src="/source/play_store.svg" alt="play store" />
            </a>
          </Button>
          <Navigator href="AdminLogin" target="_self">
            관리자 로그인
          </Navigator>
        </ButtonWrapper>
      </HeaderWrapper>
    </Container>
  )
}
